import { Typography, Box } from '@mui/material';

const CategoryList: React.FC = () => {
  return (
    <Box>
      <Typography variant="h4">Categories</Typography>
      <Typography>Category list component - to be implemented</Typography>
    </Box>
  );
};

export default CategoryList;
